import React from 'react';
import '../Form.css'

class Payment extends React.Component{

    render(){
        return <div className="form__orderContainer--payment">
                    <h3>Payment Methods</h3>
                    <form>
                        <input type="radio" name="bankTransfer" value="bankTransfer" />
                        <label for="bankTransfer">Male</label>
                    </form>
               </div>     
    }
}

export default Payment;
